import React from 'react';
import Task from './Task';

const TaskList = ({ tasks, onTaskComplete, onTaskRemove }) => {
  return (
    <div>
      {tasks.map((task) => (
        <Task 
          key={task.id} 
          task={task} 
          onTaskComplete={onTaskComplete} 
          onTaskRemove={onTaskRemove} 
        />
      ))}
    </div>
  );
};

export default TaskList;
